import add3 from './Images/a3.jpg';
import add4 from './Images/a4.jpg';
import add5 from './Images/a5.jpg';
import add6 from './Images/a6.jpg';

const Sdata = [
    {
        imgsrc:add1,
        title:"web development",
    },
    {
        imgsrc:add2,
        title:"App development",
    },
    {
        imgsrc:add3,
        title:"Software development",
    },
    {
        imgsrc:add4,
        title:"Digital Marketing",
    },
    {
        imgsrc:add5,
        title:"Android development",
    },
    {
        imgsrc:add6,
        title:" Development",
    },
];
export default Sdata;
